// src/components/AverageTimePerTeamChart.js
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, Legend } from "recharts";

export default function AverageTimePerTeamChart({ data }) {
  if (!data || data.length === 0) {
    return <p className="text-center text-gray-500">Nu existÄƒ date pentru grafic.</p>;
  }

  return (
    <ResponsiveContainer width="100%" height={400}>
      <BarChart
        data={data}
        margin={{ top: 20, right: 30, left: 20, bottom: 40 }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="assigned_person" angle={-45} textAnchor="end" interval={0} />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="ticket_count" fill="#3b82f6" barSize={50} />
      </BarChart>
    </ResponsiveContainer>
  );
}
